import { StyleSheet, Text, View, Dimensions, TextInput } from 'react-native'
import React from 'react'

const MasterPortrait = (props) => {
  // Lấy navigate và route từ props
  const { navigation, route } = props
  const { navigate, goBack } = navigation

  // Lấy kích thước toàn màn hình
  const screenWidth = Dimensions.get('window').width
  const screenHeight = Dimensions.get('window').height
  return (
    <View
      style={{
        height: screenHeight,
        width: screenWidth,
        backgroundColor: '#fff',
      }}
    >
      <Text
        style={{
          marginTop: 13,
          marginHorizontal: 15,
          fontWeight: 'bold',
          fontSize: 16,
          color: '#595959',
        }}
      >
        Welcome, Jala!
      </Text>
      <Text
        style={{
          marginTop: 6,
          marginHorizontal: 15,
          fontWeight: 'bold',
          fontSize: 18,
          color: '#161616',
        }}
      >
        Choice you Best food
      </Text>

      <TextInput
        style={{
          marginTop: 20,
          marginHorizontal: 15,
          width: screenWidth * 0.75,
          height: screenHeight * 0.06,
          borderWidth: 1,
          borderColor: '#b5b5b5',
          borderRadius: 3,
          backgroundColor: '#f9f9f9',
          paddingLeft: 10,
          fontWeight: 'bold',
        }}
        placeholder="Search food"
        placeholderTextColor="#b5b5b5"
      />
      <View
        style={{
          marginTop: 20,
          flexDirection: 'row',
          alignItems: 'center',
          justifyContent: 'space-between',
          marginHorizontal: 15,
        }}
      >
        <View
          style={{
            width: screenWidth * 0.2,
            height: screenHeight * 0.045,
            backgroundColor: '#f9f9f9',
            borderWidth: 1,
            borderColor: '#b5b5b5',
            borderRadius: 5,
          }}
        ></View>
        <View
          style={{
            width: screenWidth * 0.2,
            height: screenHeight * 0.045,
            backgroundColor: '#f9f9f9',
            borderWidth: 1,
            borderColor: '#b5b5b5',
            borderRadius: 5,
          }}
        ></View>
        <View
          style={{
            width: screenWidth * 0.2,
            height: screenHeight * 0.045,
            backgroundColor: '#f9f9f9',
            borderWidth: 1,
            borderColor: '#b5b5b5',
            borderRadius: 5,
          }}
        ></View>
      </View>
    </View>
  )
}

export default MasterPortrait

const styles = StyleSheet.create({})
